import Link from 'next/link'

const Header = props => (
  <div className="font-color-green margin-top-med">
    <div className="inline-block font-weight-bold margin-left-med">Discover Algo</div>
    <div className="float-right inline-block">
      <div className="inline-block margin-right-med">Learn</div>
      <div className="inline-block margin-right-med">Submit Answer</div>
      <div className="inline-block margin-right-med">Leaderboard</div>
    </div>
  </div>
);

export default Header;
